import React, { useEffect, useState } from 'react';

function GreaseProducts() {
  const [greaseProducts, setGreaseProducts] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchGreaseProducts = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/grease');
        const data = await response.json();
        if (response.ok) {
          setGreaseProducts(data);
        } else {
          setError('Failed to fetch grease products');
        }
      } catch (err) {
        setError('Failed to fetch data');
      }
    };

    fetchGreaseProducts();
  }, []);

  return (
    <div>
      <h2>Grease Products</h2>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <ul>
        {greaseProducts.map((product) => (
          <li key={product._id}>
            <h3>{product.name}</h3>
            <p>Price: ${product.price}</p>
            <p>Stock: {product.stock}</p>
            <p>Category: {product.category}</p>
            <img src={product.image} alt={product.name} />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default GreaseProducts;
